@doflamingochild mistaking it for his Navigator, Nami, and his Archeologist, Robin, Luffy suddenly jumped off from the structure before it collapsed to nothing more than rumble. 

❝NAMI! ROBIN! IS THAT YOU!? THERE'S NOBODY HERE! Oi! AND I'M HUNGRY TOO! WHERE ARE YOU GUYS!?❞

He shouted↬
